import React, { useEffect, useState } from 'react';

const SHEET_ID = '2PACX-1vTi6e6OPof1gpDRsMXMhtmROv7dr1aWNtnWI53pbHSZoBOCG_dIlHkMTD8bS9QxY94MGPNbt8U4gx4Q';
const AGENT_NAMES = ['Martin', 'Hassan', 'Magnus', 'Robin', 'Espen', 'Kris', 'Nora'];

export default function AgentGrid() {
  const [agents, setAgents] = useState([]);

  useEffect(() => {
    async function fetchAgents() {
      try {
        const requests = AGENT_NAMES.map(name =>
          fetch(`https://opensheet.elk.sh/${SHEET_ID}/${name}`).then(res => res.json())
        );
        const results = await Promise.all(requests);
        const flatAgents = results.flat();
        setAgents(flatAgents);
      } catch (error) {
        console.error('Klarte ikke hente agenter:', error);
      }
    }

    fetchAgents();
  }, []);

  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 p-6">
      {agents.map((agent, idx) => (
        <div
          key={idx}
          className="rounded-2xl shadow-lg border border-gray-200 p-6 hover:shadow-xl transition"
          style={{ borderColor: agent.Fargekode }}
        >
          <img
            src={agent.AvatarURL}
            alt={agent.Navn}
            className="w-24 h-24 rounded-full mx-auto mb-4 object-cover"
          />
          <h2 className="text-xl font-bold text-center">{agent.Navn}</h2>
          <p className="text-sm text-center text-gray-500">{agent.Tittel}</p>
          <p className="text-sm text-center mt-2">{agent.Beskrivelse}</p>

          {agent.Sponsor === 'Ja' && agent.Annonsør && (
            <p className="text-xs text-center mt-2 text-green-600">
              Sponset av {agent.Annonsør}
            </p>
          )}

          <a
            href={agent.EksternLenke}
            className="block mt-4 text-center bg-blue-600 text-white py-2 rounded hover:bg-blue-700"
          >
            Start beregning
          </a>
        </div>
      ))}
    </div>
  );
}
